from sympy import primepi, integer_nthroot, mobius
def A303554(n):
    def f(x): return int(n+x-sum(primepi(integer_nthroot(x,k)[0]) for k in range(2,x.bit_length()))-sum(mobius(k)*(x//k**2) for k in range(1, isqrt(x)+1)))
    m, k = n, f(n)
